<template>
  <div class="container text-center">
    <img class="img-fluid" :src="image" />
    <div class="h1 mt-5">404 error {{ page }}</div>
    <div class="h3">You underestimate the power of the dark side</div>
    <div class="h3">{{ countDown }}</div>
    <button class="btn btn-primary mt-3" @click="clickGoBack">Go back</button>
  </div>
</template>

<script>
export default {
  data() {
    return {
      countDown: 60,
      page: "",
      image:
        "data:image/png;base64,",
    };
  },
  mounted() {
    const url = new URL(document.URL);
    this.page = url.pathname;
    this.countDownTimer();
  },
  methods: {
    clickGoBack() {
      this.$router.push(`/`);
    },
    countDownTimer() {
      if (this.countDown > 0) {
        setTimeout(() => {
          this.countDown -= 1;
          this.countDownTimer();
        }, 1000);
      } else {
        this.clickGoBack();
      }
    },
  },
};
</script>
